            function base64tobytes(b64data){
                var binary_vale = atob(b64data);
                var binary_length = binary_vale.length;
                bytes_data = new Uint8Array(binary_length);

                for (var i=0;i<binary_length;i++){
                    bytes_data[i] = binary_vale.charCodeAt(i);
                }

                return bytes_data.buffer;
            }
